import { connect } from "react-redux";
import { actionCreators as dataActions } from "../redux/modules/data";
import Container from "./container";

const mapStateToProps = (state, ownProps) => {
  const { mmr:{summner_name,mmrtotier,mmrtotiershort,mmr,tiermmr},router: { location } } = state;
  return {
    location,
    summner_name,
    mmrtotier,
    mmrtotiershort,
    mmr,
    tiermmr
  };
};

const mapDispatchToProps = (dispatch, ownProps) => {
  const { params: { summonername } }  = ownProps.match;
  return {
    getmmrdata : () => {
      dispatch(dataActions.getMMR(summonername));
    }
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Container);
